const Navbar = () => {
  return (
    <div className="p-0 m-0 navbar d-flex  justify-content-center align-items-center">
      <h3 className="p-2 m-0  col-md-4">Bonte Takeaway</h3>
      <ul className="p-2 m-0 col-md-8 d-flex justify-content-start align-items-center">
        <li className="p-0 m-3">Home</li>
        <li className="p-0 m-3">About </li>
        <li className="p-0 m-3">Contact Us</li>
      </ul>
    </div>
  );
};

export default Navbar;
